const width = 4110;
const height = 5300;
const img = new Image();
img.src = "data:image/png;base64,";

window.onload = () =>
{
    mdc.autoInit();
    preview.width = width;
    preview.height = height;
    run.onclick = () => generate();
    save.onclick = () => save_as_image();
    loading.remove();
    generate();
}

function generate()
{
    let can = preview;
    can.width = width;
    can.height = height;
    let c = can.getContext("2d");
    //bg
    c.rect(0, 0, width, height);
    c.fillStyle = "white";
    c.fill();
    //happy guy
    c.drawImage(img, 400, 1600);
    //buta
    c.fillStyle = "black";
    c.font = "700pt main";
    c.textBaseline = "bottom";
    c.textAlign = "center";
    c.fillText(im.value + "豚", width / 2, 1500);
    //get out
    c.rotate(27 * Math.PI / 180);
    c.font = "900pt main";
    c.fillStyle = "red";
    c.fillText(want_do.value, 4300, 1800);
    let loop_count = (parseInt(count.value) - 1) * 2 + (chuu.checked?1:0);
    for(let i = 0; i < loop_count; i++)
    {
        //new canvas
        let new_can = document.createElement("canvas");
        new_can.width = width;
        new_can.height = height;
        c = new_can.getContext("2d");
        //bg
        c.rect(0, 0, width, height);
        c.fillStyle = "white";
        c.fill();
        //draw old canvas on ""
        c.drawImage(can, 1000, 200, width / 4, height / 4);
        //happy guy
        c.drawImage(img, 400, 1600);
        //buta
        c.fillStyle = "black";
        c.font = "700pt main";
        c.textBaseline = "bottom";
        c.textAlign = "end";
        c.fillText("\"", 1000, 1500);
        c.textAlign = "start";
        c.fillText("\"", 1000 + width / 4, 1500);
        c.textAlign = "center";
        c.fillText("豚", 3022, 1500);
        //get out
        c.rotate(27 * Math.PI / 180);
        c.font = "900pt main";
        c.fillStyle = "red";
        c.fillText(want_do.value, 4300, 1800);
        //set old canvas to new canvas
        can = new_can;
    }
    if(loop_count > 0)
    {
        preview.width = preview.width;
        preview.getContext("2d").drawImage(can, 0, 0);
    }
}
function save_as_image()
{
    preview.toBlob((blob) =>
    {
        let url = URL.createObjectURL(blob);
        let a = document.createElement("a");
        a.download = `${im.value}${kuro.checked?"黑":"廚"}_${count.value}.png`;
        a.href = url;
        a.click();
    });
}